import React from 'react';
import NavBar from '../components/NavBar';
import Circle from '../components/Circle';
import '../styles/App.css';
import "../styles/Home.css";
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Router,
  Routes,
  Outlet,
} from "react-router-dom";
import Intro from '../components/Intro';

const router = createBrowserRouter([
  {
    path: "/",
    element: <Intro />,
  }, {
    path: "/test",
    element: <h1>test</h1>,
  },
]);

function App() {
  return (
    <Router>
    <div className="App">
      <NavBar />
      <Routes>
        <Route path="/componenta" element={<Intro />} />
        <Route path="/componentb" element={<Circle />} />
      </Routes>
    </div>
  </Router>
    );
    {/* <div className="catalog"> */}
    {/* </div> */}
}

export default App;
